import React from 'react'
const google = window.google;

const MapBase = () => {
    
    function initMap(){
        var options = {
            zoom : 17,
            center: {lat: 48.852024, lng:2.28666}
        }

        var map = new google.maps.Map(document.getElementById("map"), options);
       }
       
    return (
        <>
        <div id="map"></div>
        <script async defer
            src="https://maps.googleapis.com/maps/api/js?key=AIzaSyCIc-9Qw-Ime5dg4ADN5kCpgY-hbPkBwKQ&callback=initMap&libraries=&v=weekly"
            ></script> 
        </>
  );
};

export default MapBase;
